(function ctcountdown () {
  'use strict'

  function getTimeRemaining( endtime ) {
    const t = Date.parse( endtime ) - Date.parse( new Date() );
    const seconds = Math.floor( ( t / 1000 ) % 60 );
    const minutes = Math.floor( ( t / 1000 / 60 ) % 60 );
    const hours = Math.floor( ( t / ( 1000 * 60 * 60 ) ) % 24 );
    const days = Math.floor( t / ( 1000 * 60 * 60 * 24 ) );
    return {
      'total': t,
      days,
      hours,
      minutes,
      seconds
    };
  }

  function initializeClock( el, endtime, done ) {
    const clock = el;
    const daysSpan = clock.querySelector( '.ct-countdown__days' );
    const hoursSpan = clock.querySelector( '.ct-countdown__hours' );
    const minutesSpan = clock.querySelector( '.ct-countdown__minutes' );
    const secondsSpan = clock.querySelector( '.ct-countdown__seconds' );

    function updateClock() {
      const t = getTimeRemaining( endtime );

      if ( t.total <= 0 ) {
        const split = done.length / 4
        daysSpan.innerHTML = done.slice( 0, split )
        hoursSpan.innerHTML = done.slice( split, split * 2 )
        minutesSpan.innerHTML = done.slice( split * 2, split * 3 )
        secondsSpan.innerHTML = done.slice( split * 3, split * 4 )
      } else {
        daysSpan.innerHTML = t.days;
        hoursSpan.innerHTML = ( '0' + t.hours ).slice( -2 );
        minutesSpan.innerHTML = ( '0' + t.minutes ).slice( -2 );
        secondsSpan.innerHTML = ( '0' + t.seconds ).slice( -2 );
      }

      if ( t.total <= 0 ) {
        clearInterval( timeinterval );
      }
    }

    updateClock();
    var timeinterval = setInterval( updateClock, 1000 );
  }

  if (document.querySelectorAll('.ct-countdown').length) {

    Array.prototype.forEach.call(document.querySelectorAll('.ct-countdown'), function (el) {
      const element = el;

      // - DATE FORMAT: MM/DD/YYYY HOURS:MINUTES:SECONDS
      const deadline = element.getAttribute('data-countdown-to') || "06/20/2016 15:19:50";

      initializeClock(element, deadline, "Shipping");
    });
  }
})();

