( function ( $ ) {
  "use strict";
  let notTriggered = true;
  /* ==================== */

  /* ==== PIE CHARTS ==== */
  function charts() {

    if ( notTriggered ) {
      $( '.ct-js-pieChart' ).each( function () {
        const $this = $( this );
        const $color = validatedata( $( this ).attr( 'data-ct-firstColor' ), "#2b8be9" );
        const $color2 = validatedata( $( this ).attr( 'data-ct-secondColor' ), "#eeeeee" );
        const $cutout = validatedata( $( this ).attr( 'data-ct-middleSpace' ), 90 );
        const $stroke = validatedata( $( this ).attr( 'data-ct-showStroke' ), false );
        const $margin = validatedata( $( this ).attr( 'data-ct-margin' ), false );
        const options = {
          responsive: true,
          percentageInnerCutout: $cutout,
          segmentShowStroke: $stroke,
          showTooltips: false
        };
        const doughnutData = [ {
          value: parseInt( $this.attr( 'data-ct-percentage' ) ),
          color: $color,
          label: false
        }, {
          value: parseInt( 100 - $this.attr( 'data-ct-percentage' ) ),
          color: $color2
        } ];

        const ctx = $this[ 0 ].getContext( "2d" );
        window.myDoughnut = new Chart( ctx ).Doughnut( doughnutData, options );
      } )
    }
  }


  $( window ).on( 'scroll load', function () {
    if (!device.mobile() && !device.tablet()) {
      if ( $( '.ct-js-pieChart' ).visible() ) {
        charts();

        notTriggered = false;
      }
    }
  } );

  $( window ).on( 'load', function () {
    if (device.mobile() || device.tablet()) {
      charts();
    }
  } );

} )( jQuery );
